import React from "react";

const Projects = () => {
  return (
    <section id="projects">
      <h2>Projetos</h2>
      <ul>
        <li>
          <strong>Projeto 1</strong>: Aplicação de To-Do List - 
          <a href="https://github.com/seu-github/projeto1">GitHub</a>
        </li>
        <li>
          <strong>Projeto 2</strong>: Portfólio Pessoal - 
          <a href="https://github.com/seu-github/portfolio">GitHub</a>
        </li>
      </ul>
    </section>
  );
};

export default Projects;
